import React, { Component } from 'react'
import {
    Route,
    NavLink,
    HashRouter
} from 'react-router-dom'
import About from "./About"
import Contact from "./Contact"
import Resume from "./Resume"
import './NavButtons.css'


class NavButton extends Component {
    render() {
        return (
            <HashRouter>
            <aside className="NavBar">

            <div className="NavButton"><a href="/about"><span>About</span></a></div>
            <div className="NavButton"><a href="/contact"><span>Contact</span></a></div>
            <div className="NavButton"><a href="/portfolio"><span>Portfolio</span></a></div>
            <div className="NavButton"><a href="/resume"><span>Resume</span></a></div> 

            </aside>
            </HashRouter>
        )
    }
}


export default NavButton;
